import { BrowserRouter as Router, Route, Redirect, Switch } from 'react-router-dom';
const PrivateRoute = ({ component: Component, ...rest }) => {
    const token = localStorage.getItem('token');

    return (
      <Route
        {...rest}
        render={(props) =>
          token ? (
            <Component {...props} />
          ) : (
            <Redirect to="/login" />
          )
        }
      />
    );
  };

  export default PrivateRoute;
